import React from 'react';
import styled from 'styled-components';

const App = () => {
  const Button = styled.button`
     {
      background-color: green;
      color: #fff;
      font-size: 16px;
      text-align: center;
      padding: 6px 30px;
    }
  `;

  const Para = styled.p`
    color: red;
  `;
  return (
    <>
      <Button className="btn">Subcribe Shyam</Button>
      <p>Shyam Tahput</p>
    </>
  );
};

export default App;
